import React, { Component } from "react";
import NameForm from "./NameForm";
import DropdownCity from "./DropdownCity";
import './NameForm.css';


class Home extends Component {

  render() {
    return (
      <div>
        <h1>Welcome to the Big League</h1>
        <NameForm/>
        <DropdownCity/>
      </div>
    );
  }
}

export default Home;
